import './Header.css';
const Header = ({title}) =>{
    return (
        <header>
        <h1>{title}</h1>
        <h1>Let's Learn{title.name}</h1>
        </header>
        );
}
Header.defaultProps = {
    title: 'Task Tracker',
    }
export default Header;
